package page_objects.asidebar;import com.codeborne.selenide.SelenideElement;import page_objects.base.BasePage;import page_objects.alerts_frame_windows.AlertsFrameWindowsPage;import static com.codeborne.selenide.Selectors.byText;import static com.codeborne.selenide.Selenide.$;import static com.codeborne.selenide.Selenide.page;public class DemoqaAsidebarPage extends BasePage {    private final SelenideElement ALERTS_FW_CATEGORY = $(byText(            "Alerts, Frame & Windows"));    public AlertsFrameWindowsPage clickOnAlertsFwCategory() {        waitElementIsVisible(ALERTS_FW_CATEGORY).scrollTo().click();        return page(AlertsFrameWindowsPage.class);    }}